import React from 'react';

interface Product {
  id: number;
  name: string;
  price: number;
  description?: string;
}

interface ProductListProps {
  products: Product[];
}

const ProductList: React.FC<ProductListProps> = ({ products }) => {
  return (
    <ul>
      {products.map(product => (
        <li key={product.id}>
          <h2>{product.name}</h2>
          <p>Price: ${product.price}</p>
          <p>{product.description}</p>
        </li>
      ))}
    </ul>
  );
};

export default ProductList;
